//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
//////////////////////////////^^^^^^^^-----^^^^^^^^/////////////////////////////
//////////////////////////////(@@@@@@@@@@@@@@@@@@@//////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////@@@@@@@@@@@@@//////(@@@@@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@@@@@@@///@@@@@@@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@@@@@@@@/@@@@@@@@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@/@@@@@@@@@@@@@/@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@//@@@@@@@@@@@//@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@///////////////@@@@@@@@@///////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////@@@@@@@@@///////////////@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@//@@@@@@@@@@@//@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@/@@@@@@@@@@@@@/@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@@@@@@@@/@@@@@@@@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@@@@@@@///@@@@@@@@@@@@@@@///////////////////////
////////////////////////@@@@@@@@@@@@@%/////&@@@@@@@@@@@@@///////////////////////
/////////////////////////////////@@@/////////@@@////////////////////////////////
/////////////////////////////////@@///////////@@////////////////////////////////
/////////////////////////////////@/////////////@////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////

contract Menace is ERC721, ERC721Enumerable, ERC721Burnable, Ownable {
    using Counters for Counters.Counter;

    // Counter for number of menaces 
    Counters.Counter private _menaceCounter;
    // Max token supply
    uint public MAX_MENACE = 10000;
    // Mint Price
    uint256 public constant menacePrice = 150000000000000000; //0.15 ETH
    // Base URI
    string public baseURI;
    // Sale is active
    bool public saleIsActive = false;
    // Presale is active
    bool public preSaleIsActive = false;
    // Max purchchase per txn
    uint public constant maxMenaceTxn = 2;
    // shareholders, shares, and manager
    address[3] private _shareholders;

    uint[3] private _shares;

    address private _manager;
    // starting index and block and provenance
    uint256 public startingIndex;

    uint256 public startingIndexBlock;

    string public provenance;

    // Presale
    mapping(address => bool) addressToPreSale;
    mapping(address => uint256) addressToPresaleMintCount;

    // Events
    event PaymentReleased(address to, uint256 amount);
    event ReserveMenace(address to);
    event FirstToMenaceWorld(address to, uint256 amount);
    event WelcomeToMenaceWorld(address to, uint256 amount);

    // constructor
    constructor() ERC721("MenaceWorld", "MENACE"){
        // shareholders test network
        _shareholders[0] = 0x24209282E198E7A807806F55a3322b98d3C65B29;
        _shareholders[1] = 0xDfaAC748709D31d95D638dDBc2BCb8462dfd2076;
        _shareholders[2] = 0xc593eE28Fc40c256d08D040A12FA1AF4D8ef26Bb;
    }

    /** Set Manager */
    function setManager(address manager) public onlyOwner {
        _manager = manager;
    }
    
    /**
     * Throws if called by any account other than the owner or manager.
     */
    modifier onlyOwnerOrManager() {
        require(owner() == _msgSender() || _manager == _msgSender(), "Caller is not the owner or manager");
        _;
    }

    /**
     * Set base URI
     */
    function setBaseURI(string memory newBaseURI) public onlyOwnerOrManager {
        baseURI = newBaseURI;
    }
    
    function _baseURI() internal view virtual override returns (string memory){
        return baseURI;
    }

    function totalToken() public view returns (uint256) {
        return _menaceCounter.current();
    }
    
    function contractBalance() public view onlyOwnerOrManager returns (uint256) {
        return address(this).balance;
    }

    function addWalletToPreSale(address _address) public onlyOwnerOrManager {
        addressToPreSale[_address] = true;
    }

    function isWalletInPreSale(address _address) public view returns (bool) {
        return addressToPreSale[_address];
    }

    function preSaleMenaceMinted(address _address) public view returns (uint256){
        return addressToPresaleMintCount[_address];
    }

    /*
    * Set Sale
    */
    function flipSale() public onlyOwnerOrManager {
        saleIsActive = !saleIsActive;
    }

    function stateSail() public view returns (bool){
        return saleIsActive;
    }

    function flipPreSale() public onlyOwnerOrManager {
        preSaleIsActive = !preSaleIsActive;
    }

    function statePreSail() public view returns (bool){
        return preSaleIsActive;
    }

    /**
    *  Grand Prize
     */
    function withdrawForGiveaway(uint256 amount, address payable to) public onlyOwnerOrManager {
        uint256 payment = amount * 10 ** 18;
        to.transfer(payment);
        emit PaymentReleased(to, amount);
    }

    /**
     * Withdraw 
     */
    function withdraw(uint256 amount) public payable {
        require(address(this).balance >= amount, "Insufficent funds.");
        
        uint256 len = _shareholders.length;
        uint256 payment = amount * 10 ** 18;
        payment = payment / len;
        for (uint256 i=0; i<len; i++){
            // send payment to owner wallet
            payable(_shareholders[i]).transfer(payment);
            emit PaymentReleased(_shareholders[i], payment);
        }
    }

    /*
    * Mint reserved NFTs for giveaways, devs, etc.
    */
    function reserveMintMenace(uint256 reserveAmount, address mintAddress) public onlyOwnerOrManager {
        require(totalSupply() <= MAX_MENACE, "Purchase would exceed max supply of Menaces");
        uint256 supply = _menaceCounter.current();
        for (uint256 i=0; i<reserveAmount; i++){
            _safeMint(mintAddress, supply + 1);
            _menaceCounter.increment();
            supply = _menaceCounter.current();
        }
        emit ReserveMenace(mintAddress);
    }

    /**
    * Mint for presale
    */
    function preMintMenace(uint256 numberOfTokens) public payable {
        require(preSaleIsActive, "Pre Sale must be active to mint Menaces");
        require(addressToPreSale[msg.sender] == true, "Sorry, you're address is not whitelisted for presale");
        require(addressToPresaleMintCount[msg.sender] + numberOfTokens <= MAX_MENACE, "Purchase would exceed presale limit");
        require(menacePrice * numberOfTokens <= msg.value, "Ether value sent is not correct");

        for (uint256 i=0; i<numberOfTokens; i++){
            uint256 mintIndex = _menaceCounter.current()+1;
            if (mintIndex <= MAX_MENACE){
                _safeMint(msg.sender, mintIndex);
                _menaceCounter.increment();
                addressToPresaleMintCount[msg.sender] += 1;
            }
        }     
        emit FirstToMenaceWorld(msg.sender, numberOfTokens);       
    }


    /**
     * Mint Menace
    */
    function mintMenace(uint256 numberOfTokens) public payable {
        require(saleIsActive, "Sale must be active to mint Menaces");
        require(numberOfTokens <= maxMenaceTxn, "You can only mint 2 Menaces at a time");
        require(totalSupply() + numberOfTokens <= MAX_MENACE, "Purchase would exceed max supply of Menaces");
        require(menacePrice * numberOfTokens <= msg.value, "Ether value sent is not correct");

        for (uint256 i=0; i<numberOfTokens; i++){
            uint256 mintIndex = _menaceCounter.current()+1;
            if (mintIndex <= MAX_MENACE){
                _safeMint(msg.sender, mintIndex);
                _menaceCounter.increment();
            }
        }
        emit WelcomeToMenaceWorld(msg.sender, numberOfTokens);
    }

    /**
     * Set the starting index for the collection.
     */
    function setStartingIndex() public onlyOwnerOrManager {
        require(startingIndex == 0, "Starting index is already set");
        require(startingIndexBlock != 0, "Starting index block must be set");
        
        startingIndex = uint(blockhash(startingIndexBlock)) % MAX_MENACE;
        // Just a sanity case in the worst case if this function is called late (EVM only stores last 256 block hashes).
        if (block.number - startingIndexBlock > 255) {
            startingIndex = uint(blockhash(block.number - 1)) % MAX_MENACE;
        }
        // Prevent default sequence.
        if (startingIndex == 0) {
            startingIndex = 1;
        }
    }

    /**
     * Set the starting index block for the collection. Usually, this will be set after the first sale mint.
     */
    function emergencySetStartingIndexBlock() public onlyOwnerOrManager {
        require(startingIndex == 0, "Starting index is already set");
        
        startingIndexBlock = block.number;
    }

    /*     
    * Set provenance once it's calculated.
    */
    function setProvenanceHash(string memory provenanceHash) public onlyOwnerOrManager {
        provenance = provenanceHash;
    }

    /**
     * Required for ERC721Enumerable and ERC721
     */
    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

}
